const TopMovies = () => {
  return (
    <>
      <h1>Top Movies</h1>
      <div className="top-movies">
        <img
          src="https://media.giphy.com/media/b7oBeRRXGEJva/giphy.gif"
          alt="finding-nemo"
        />
        <img
          src="https://media.giphy.com/media/wrAkMP15WTLlC/giphy.gif"
          alt=""
        />
      </div>
    </>
  );
};

export default TopMovies;
